app.controller("GoogleMapCtrl",["$scope",function(a){a.myMarkers=[],a.mapOptions={center:new google.maps.LatLng(35.784,-98.67),zoom:4,mapTypeId:google.maps.MapTypeId.ROADMAP},a.addMarker=function(b,c){a.myMarkers.push(new google.maps.Marker({map:a.myMap,position:c[0].latLng}))},a.setZoomMessage=function(b){a.zoomMessage="You just zoomed to "+b+"!"},a.openMarkerInfo=function(b){a.currentMarker=b,a.currentMarkerLat=b.getPosition().lat(),a.currentMarkerLng=b.getPosition().lng(),a.myInfoWindow.open(a.myMap,b)},a.setMarkerPosition=function(a,b,c){a.setPosition(new google.maps.LatLng(b,c))}}]);